INSERT INTO `channel` VALUES (19,6,'自然有意思','大自然是最能啟發人心、最迷人的教室。\r\n本節目將以生態旅遊與自然觀察並行，帶領民眾遠觀山川大澤、細察蟲魚鳥獸，由認識自然、瞭解自然，而生守護自然之心；從生態議題與環境變遷中，省思並傳遞生態保育、永續地球的理念。'),(20,1,'哈囉自然科學','以從自然科學角度認識自然災害是什麼？從了解自然災害的本質,形成原因及災害行為,讓我們學會如何面對自然災害,學會如何與大自然共處。'),(21,1,'設計好行銷','推銷產品形塑形象都需要行銷，但是沒有設計力的行銷無法令人印象深刻，本節目告訴你如何從設計角度做好個人及企業的行銷。');
